    const info=[
        
        {id:1 ,img:'/images/test1.jpg',nom:'salah eddine chhoub' ,travail:'develppeur' ,email:'salaheddine@gamil.com' , telephone:'0612325246' ,website:'ww.tets.com'},
        {id:2 ,img:'/images/test1.jpg',nom:'salah eddine chhoub' ,travail:'develppeur' ,email:'salaheddine@gamil.com' , telephone:'0612325246' ,website:'ww.tets.com'},
        {id:3 ,img:'/images/test1.jpg',nom:'salah eddine chhoub' ,travail:'develppeur' ,email:'salaheddine@gamil.com' , telephone:'0612325246' ,website:'ww.tets.com'},
