        {id:5 ,img:'/images/test1.jpg',nom:'salah eddine chhoub' ,travail:'develppeur' ,email:'salaheddine@gamil.com' , telephone:'0612325246' ,website:'ww.tets.com'},
        {id:6 ,img:'/images/test1.jpg',nom:'salah eddine chhoub' ,travail:'develppeur' ,email:'salaheddine@gamil.com' , telephone:'0612325246' ,website:'ww.tets.com'},
    ]

   const members = info.map(function(member){

            return <Prstest
        
                key={member.id}
                nom={member.nom}
                img={member.img}
                travail={member.travail}
                email={member.email}
                telephone={member.telephone}
                website={member.website}
            />
    });


    return(
        <div className='row'>
           {members}
        </div>
    );
}

export default Prs;
